{'post_id': '728132902691381', 'time': datetime.datetime(2023, 11, 7, 10, 38, 33), 'text': 'Trailer cuối cùng của The Marvels.
Trận chiến này sẽ không dừng lại ở một vũ trụ, cánh cổng không gian đã mở ra và kéo theo đó là sự hủy hiệt. Có vẻ như cả vợ chồng nhà Loki đều thích mở cổng không gian mang tàu vũ trụ đến đánh nhà người ta.

The Marvels đã mở bán vé tại tất cả các rạp trên toàn quốc'}

{'post_id': '727704986067506', 'time': datetime.datetime(2023, 11, 6, 16, 55, 6), 'text': 'Nhìn thì trông chiếc Mèo cute thế thôi chứ thực ra..... 😂

_______________________________
The Marvels khởi chiếu tại các rạp trên toàn quốc ngày 10/11'}

{'post_id': '725193119652026', 'time': datetime.datetime(2023, 11, 2, 12, 0, 5), 'text': 'Hoa hậu thì đẹp đó nhưng ánh mắt tôi đổ dồn hết cho Hoàng Thượng phía dưới 🐱
Hôm qua còn thấy bà Thùy TIên hóa thân thành Spider-Elsa mà hôm nay đóng nguyên bộ Captain Marvel trông cháy thật đó 🔥🔥🔥

Mọi người nhớ mua vé The Marvels ra rạp từ 9.11 sắp tới tại các rạp trên toàn quốc nha, hy vọng có nhiều suất chiếu như phim Việt'}

{'post_id': '721258360045502', 'time': datetime.datetime(2023, 10, 26, 20, 57, 22), 'text': 'Nói chút về Loki - everywhere everything all at once

Đã gần được 1 nửa hành trình của series Loki season 2 nhưng có thể nói là người xem hoàn toàn chưa biết được điều gì đang chờ đợi ở phía trước, tiếp nối vàoXem thêm mạch phim của mùa đầu tiên với quá nhiều thông tin khiến cho người xem bắt đầu bị đánh lạc hướng vào hành trình truy lùng và cứu lấy dòng thời gian của Loki mà không để ý rằng tất cả mọi chuyện vốn vẫn đều nằm trong dự định của He Who Remains.
Loki, Sylvie, Ms.Minutes hay TVA tất cả chỉ đều hành động theo bản năng của họ mà không có bất kì khoản thời gian nào để dừng lại suy nghĩ rằng quyết định của mình có chính xác hay không. Mọi thứ khi này đều dồn vào Victor Timely, một biến thể… Xem thêm'}

{'post_id': '716243487213656', 'time': datetime.datetime(2023, 10, 18, 16, 15, 4), 'text': 'Sự kiện quảng bá cho series LOKI của Marvel tại London (Anh). Khách mời khi tham gia sự kiện sẽ được tham quan trải nhiệm các khung cảnh của trụ sở TVA

